import { CatalogoService } from 'src/app/services/catalogo.service';
import { Component, OnInit } from '@angular/core';
import { Mete } from 'src/app/models/mete.model';
import { NgForm } from '@angular/forms';
import { Pacchetto } from 'src/app/models/pacchetto.model';

@Component({
  selector: 'app-backoffice-add',
  templateUrl: './backoffice-add.component.html',
  styleUrls: ['./backoffice-add.component.css'],
})
export class BackofficeADDComponent implements OnInit {
  nome!: string;
  descrizione!: string;
  meta!: Mete;
  costo!: number;
  disponibilita!: number;
  assicurazione!: boolean;
  vaccino!: boolean;
  passaporto!: boolean;
  giornoPartenza!: Date;
  giornoRitorno!: Date;
  img!: string;
  pacchetti: Pacchetto[] = [];
  mete: Mete[] = [];
  constructor(private catalogoService: CatalogoService) {}
  ngOnInit(): void {
    this.catalogoService.getMete().subscribe();
    console.log(this.meta);
  }

  addPacchetto() {
    const nuovoPacchetto: Pacchetto = new Pacchetto(
      this.nome,
      this.descrizione,
      this.meta,
      this.costo,
      this.disponibilita,
      this.assicurazione,
      this.vaccino,
      this.passaporto,
      this.giornoPartenza,
      this.giornoRitorno
    );
    this.catalogoService
      .addPacchetti(nuovoPacchetto)
      .subscribe((dati) => console.log(dati));
  }
}
<div class="form">
    <form #aggiuntaPacchetti="ngForm" (ngSubmit)="addPacchetto()">
        <label>Nome Pacchetto</label>
        <input type="text" name="nome" [(ngModel)]="nome"required>
        <label>Descrizione minima</label>
        <input type="text" name="descrizione" [(ngModel)]="descrizione" required>
        <label for="mete">Meta</label>
        <label>Costo</label>
        <input type="number" name="costo" [(ngModel)]="costo" required>
        <label>Disponibilità</label>
        <input type="number" name="disponibilita" [(ngModel)]="disponibilita" required>
        <label for="ass">Assicurazione</label>
        <input type="checkbox" name="assicurazione" id="ass" [(ngModel)]="assicurazione" required>
        <label for="pass">Passaporto</label>
        <input type="checkbox" name="passaporto" id="pass" [(ngModel)]="passaporto" required>
        <label for="vac">Vaccino</label>
        <input type="checkbox" name="vaccino" id="vac" [(ngModel)]="vaccino" required>
        <label>Giorno Partenza</label>
        <input type="date" name="giornoPartenza" [(ngModel)]="giornoPartenza" required>
        <label>Giorno Ritorno</label>
        <input type="date" name="giornoRitorno" [(ngModel)]="giornoRitorno" required>
        <label>Immagine</label>
        <input type="text" name="img" [(ngModel)]="img">
        <button type="submit">Aggiungi</button>
    </form>
</div>
